package com.legodo.docusign;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Map;
import java.util.logging.Logger;

import com.docusign.esign.api.AuthenticationApi;
import com.docusign.esign.api.EnvelopesApi;
import com.docusign.esign.api.AuthenticationApi.LoginOptions;
import com.docusign.esign.client.ApiClient;
import com.docusign.esign.client.ApiException;
import com.docusign.esign.model.Document;
import com.docusign.esign.model.EnvelopeDefinition;
import com.docusign.esign.model.EnvelopeSummary;
import com.docusign.esign.model.LoginAccount;
import com.docusign.esign.model.LoginInformation;
import com.docusign.esign.model.RecipientSMSAuthentication;
import com.docusign.esign.model.Recipients;
import com.docusign.esign.model.SignHere;
import com.docusign.esign.model.Signer;
import com.docusign.esign.model.Tabs;

public class DocuSignIntegration {
	
	static void send(Map<String, String> parameters) {
		List<Signer> signers = new ArrayList<Signer>();
		String docID = "1";
		String recipientEmail = "";
		String contractPhonenumber = null;
		String doc = "";
		String docName = "Test document";
		String recipientSubject = "Test docusign integration";
		
//		String anchorString = "Unterschrift";
		String anchorString = "Innovate Initials";
		signers.add(createSigner(docID, recipientEmail, "Till Schoenbein", "1",
				"1", "1", "100", "100", anchorString, "-20", contractPhonenumber));
		// signers.add(createSigner(docID, "uludesch@opentext.com", "Uwe Ludescher",
		// "82", "2", "1", "100", "100", "PDF", "+200", null));

		sendToDocuSign(doc, docName, docID, recipientSubject, signers,
				parameters);
	}
	private static void sendToDocuSign(String base64Doc,String  docName,String  docID,String  signEmailSubject,List<Signer>  signers,
			Map<String, String> parameters) {
		Logger logger = java.util.logging.Logger.getLogger("DocuSign");
		logger.log(java.util.logging.Level.SEVERE, "beginn method: sendDocuSign");

		String accountURL = parameters.get("docusign_url");//
		String accountMail = parameters.get("docusign_username");//
		String accountPW = parameters.get("docusign_pw");//
		String accountID = parameters.get("docusign_account");//
		String accountKey = parameters.get("docusign_integrationkey");//
		String signEmailStatus = "sent";
		Recipients recipients = new Recipients();

		ApiClient client = new ApiClient();
		client.setBasePath(accountURL);
		String creds = "{\"Username\":\"" + accountMail + "\",\"Password\":\""
				+ accountPW + "\",\"IntegratorKey\":\"" + accountKey + "\"}";
		client.addDefaultHeader("X-DocuSign-Authentication", creds);
		com.docusign.esign.client.Configuration.setDefaultApiClient(client);

		AuthenticationApi authApi = new AuthenticationApi();
		LoginOptions loginOps = new  AuthenticationApi.LoginOptions();
		loginOps.setApiPassword("true");
		loginOps.setIncludeAccountIdGuid("true");
		LoginInformation loginInfo = null;
		try {
			loginInfo = authApi.login(loginOps);
		} catch (ApiException e1) {
			// TODO Auto-generated catch block
			e1.printStackTrace();
		}

		// note that a given user may be a member of multiple accounts
		List<LoginAccount> loginAccounts = loginInfo.getLoginAccounts();

		logger.log(java.util.logging.Level.SEVERE, "LoginInformation: "
				+ loginAccounts);

		EnvelopeDefinition request = new EnvelopeDefinition();

		request.setEmailSubject(signEmailSubject);
		request.setStatus(signEmailStatus);

		recipients.setSigners(signers);

		request.setRecipients(recipients);

		List<Document> documents = new ArrayList<Document>();
		Document document = new Document();
		document.setName(docName);
		document.setDocumentId(docID);
		document.setDocumentBase64(base64Doc);
		documents.add(document);
		request.setDocuments(documents);

		String accountId = loginAccounts.get(0).getAccountId();

		// instantiate a new EnvelopesApi object
		EnvelopesApi envelopesApi = new EnvelopesApi();

		// call the createEnvelope() API to send the signature request!
		EnvelopeSummary envelopeSummary = null;
		try {
			envelopeSummary = envelopesApi.createEnvelope(accountId, request);
		} catch (ApiException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}

		logger.log(java.util.logging.Level.SEVERE, "resultid is: "
				+ envelopeSummary);

	}

	private static Signer createSigner(String docID, String signEmail, String signEmailName, String signEmailRecId,
			String signRoutingOrder, String PageNumber, String XPosition, String YPosition, String anchorString,
			String anchorYOffset, String smsnumber) {
		Logger logger = java.util.logging.Logger.getLogger("DocuSign");
		logger.log(java.util.logging.Level.SEVERE, "beginn method: createSigner");

		Signer signer = new Signer();
		signer.setRoutingOrder(signRoutingOrder);
		signer.setEmail(signEmail);
		signer.setName(signEmailName);
		signer.setRecipientId(signEmailRecId);

		if (smsnumber != null) {
			RecipientSMSAuthentication smsAuth = new RecipientSMSAuthentication();
			List<String> smsnumbers = new ArrayList<String>();
			smsnumbers.add(smsnumber);

			smsAuth.setSenderProvidedNumbers(smsnumbers);

			signer.setDeliveryMethod("Email");
			signer.setIdCheckConfigurationName("SMS Auth $");
			signer.setRequireIdLookup("true");
			signer.setSmsAuthentication(smsAuth);
		}
		if (anchorString != null
				|| (PageNumber != null && XPosition != null && YPosition != null))
			signer.setTabs(createTabs(docID, PageNumber, XPosition, YPosition,
					anchorString, anchorYOffset));

		return signer;
	}

	public static Tabs createTabs(String docID,String PageNumber,String XPosition,String YPosition,String anchorString,
			String anchorYOffset) {
		SignHere tab1 = new SignHere();
		tab1.setDocumentId(docID);
		tab1.setPageNumber(PageNumber);
		tab1.setXPosition(XPosition);
		tab1.setYPosition(YPosition);
		tab1.setAnchorString(anchorString);
		// tab1.setAdditionalProperties("scaleValue", 2);
		if (anchorYOffset != null)
			tab1.setAnchorYOffset(anchorYOffset);

		List<SignHere> signatureTabs = Arrays.asList(tab1);

		// assign the tab to the signer
		Tabs tabs = new Tabs();

		tabs.setSignHereTabs(signatureTabs);
		return tabs;
	}

}
